import React from "react";

import { BackgroundImgStyle } from "../../2_styles/1_layout/BackgroundImgStyle";

import { Parallax, Background } from "react-parallax";

export default function BackgroundImg({
  bgImg,
  top,
  height,
  zIndexImg,
  zIndexImgShadow
}) {
  return (
    <div>
      {/* <BackgroundImgStyle
        bgImg={bgImg}
        top={top}
        height={height}
        zIndexImg={zIndexImg}
        zIndexImgShadow={zIndexImgShadow}
      > */}

      <Parallax
        blur={10}
        bgImage={require({ bgImg })}
        bgImageAlt="the cat"
        strength={200}
      >
        Put some text content here - even an empty div with fixed dimensions to
        have a height for the parallax.
        <div style={{ height: "200px" }} />
      </Parallax>

      <div className="bgImg_shadow"></div>
      <div className="bgImg"></div>
      {/* </BackgroundImgStyle> */}
    </div>
  );
}
